import React from 'react'
import fotopaty from './img/fotopaty.jpg';

const Resume = () => {
    return (
        <div class="container-fluid">
        <h3 className="resume-h3">Patricia Ruffino</h3>
        <p className="resume-p">
            Olá, como você já bem 
        </p>
        <img className="fotopaty" src={fotopaty} alt="Foto-Patricia"/>
      </div>
    )
}

export default Resume
